import { registerDynImportEntry } from 'js/moduleLoader';
registerDynImportEntry('viewmodel/helloViewModel', () => import('viewmodel/helloViewModel'));;
export default {
    "hello": {
        "url": "/hello",
        "data": {},
        "view": "hello",
        "dependencies": []
    }
};
